// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Chingari {
    struct video{
        string videoLink;
        string videoName;
        string videoDescription;
        uint256 videoPrice;
        bool listed;
        uint256 videoLikes;
        uint256 videoComments;
        string videoCategory;
        address[] likers;
        comment[] comments;
        address owner;
        uint256 revenue;
        address[] buyers;
        mapping (address => uint256) royalty;
        uint256 royaltyPercent;
        uint256 ownPercent;
    }
    struct videonomap{
        string videoLink;
        string videoName;
        string videoDescription;
        uint256 videoPrice;
        bool listed;
        uint256 videoLikes;
        uint256 videoComments;
        string videoCategory;
        address[] likers;
        comment[] comments;
        address owner;
        uint256 revenue;
        address[] buyers;
        uint256 royaltyPercent;
        uint256 ownPercent;
    }
    struct comment{
        string line;
        address commenter;
        uint256 tip;
    }
    address[] creators;
    mapping (address => string[]) public vList;
    mapping(string => video) public linktoOwner;

    function ownDisplay(address _user)public view returns(videonomap[] memory){
        videonomap[] memory temp=new videonomap[](vList[_user].length);

        videonomap memory temp2;
        for(uint256 i=0;i<vList[_user].length;i++){
            temp2.owner = linktoOwner[vList[_user][i]].owner;
            temp2.videoLink = linktoOwner[vList[_user][i]].videoLink;
            temp2.videoName = linktoOwner[vList[_user][i]].videoName;
            temp2.videoDescription = linktoOwner[vList[_user][i]].videoDescription;
            temp2.videoPrice = linktoOwner[vList[_user][i]].videoPrice;
            temp2.listed = linktoOwner[vList[_user][i]].listed;
            temp2.videoLikes = linktoOwner[vList[_user][i]].videoLikes;
            temp2.videoComments = linktoOwner[vList[_user][i]].videoComments;
            temp2.videoCategory = linktoOwner[vList[_user][i]].videoCategory;
            temp2.likers = linktoOwner[vList[_user][i]].likers;
            temp2.comments = linktoOwner[vList[_user][i]].comments;
            temp2.revenue = linktoOwner[vList[_user][i]].revenue;
            temp2.buyers = linktoOwner[vList[_user][i]].buyers;
            temp2.royaltyPercent = linktoOwner[vList[_user][i]].royaltyPercent;
            temp2.ownPercent = linktoOwner[vList[_user][i]].ownPercent;

            temp[i]=temp2;
        }
        return temp;
    }
    function allSize()public view returns(uint256){
        uint256 k=0;
        for(uint256 i=0;i<creators.length;i++){
            for(uint256 j=0;j<vList[creators[i]].length;j++){
                k++;
            }
        }
        return k;
    }
    function allDisplay()public view returns(videonomap[] memory){
        uint256 siz=allSize();
        videonomap[] memory temp=new videonomap[](siz);
        videonomap memory temp2;
        uint256 k=0;
        for(uint256 i=0;i<creators.length;i++){
            for(uint256 j=0;j<vList[creators[i]].length;j++){
                temp2.owner = linktoOwner[vList[creators[i]][j]].owner;
                temp2.videoLink = linktoOwner[vList[creators[i]][j]].videoLink;
                temp2.videoName = linktoOwner[vList[creators[i]][j]].videoName;
                temp2.videoDescription = linktoOwner[vList[creators[i]][j]].videoDescription;
                temp2.videoPrice = linktoOwner[vList[creators[i]][j]].videoPrice;
                temp2.listed = linktoOwner[vList[creators[i]][j]].listed;
                temp2.videoLikes = linktoOwner[vList[creators[i]][j]].videoLikes;
                temp2.videoComments = linktoOwner[vList[creators[i]][j]].videoComments;
                temp2.videoCategory = linktoOwner[vList[creators[i]][j]].videoCategory;
                temp2.likers = linktoOwner[vList[creators[i]][j]].likers;
                temp2.comments = linktoOwner[vList[creators[i]][j]].comments;
                temp2.revenue = linktoOwner[vList[creators[i]][j]].revenue;
                temp2.buyers = linktoOwner[vList[creators[i]][j]].buyers;
                temp2.royaltyPercent = linktoOwner[vList[creators[i]][j]].royaltyPercent;
                temp2.ownPercent = linktoOwner[vList[creators[i]][j]].ownPercent;
                temp[k]=temp2;
                k++;
            }
        }
        return temp;
    }
    function create(string memory link,string memory _name,string memory _desc,string memory _cate,uint256 val) public{
        bool already=false;
        for(uint256 i=0;i<creators.length;i++){
            if(creators[i]==msg.sender){
                already=true;
                break;
            }
        }
        if(!already){
            creators.push(msg.sender);
        }
        vList[msg.sender].push(link);
        linktoOwner[link].owner = msg.sender;
        linktoOwner[link].videoLink = link;
        linktoOwner[link].videoName = _name;
        linktoOwner[link].videoDescription = _desc;
        linktoOwner[link].videoCategory = _cate;
        linktoOwner[link].videoPrice = val;
        linktoOwner[link].videoLikes = 0;
        linktoOwner[link].listed=false;
        linktoOwner[link].videoComments = 0;
        linktoOwner[link].revenue = 0;  
        linktoOwner[link].ownPercent = 100;
        linktoOwner[link].royaltyPercent = 0;
    }
    function like(string memory link) public payable{
        linktoOwner[link].videoLikes++;
        linktoOwner[link].likers.push(msg.sender);
        linktoOwner[link].revenue += msg.value;
        payable(linktoOwner[link].owner).transfer(msg.value*linktoOwner[link].ownPercent/100);
        for(uint256 i=0;i<linktoOwner[link].buyers.length;i++){
            payable(linktoOwner[link].buyers[i]).transfer(msg.value*linktoOwner[link].royalty[linktoOwner[link].buyers[i]]/100);
        }
    }
    function newcomment(string memory link,string memory _comment) public{
        linktoOwner[link].videoComments++;
        comment memory nw;
        nw.line = _comment;
        nw.commenter = msg.sender;
        nw.tip = 0;
        linktoOwner[link].comments.push(nw);
    }
    function commentTip(string memory link,string memory _comment) public payable{
        linktoOwner[link].videoComments++;
        comment memory nw;
        nw.line = _comment;
        nw.commenter = msg.sender;
        nw.tip = msg.value;
        linktoOwner[link].comments.push(nw);
        linktoOwner[link].revenue += msg.value;
        payable(linktoOwner[link].owner).transfer(msg.value*linktoOwner[link].ownPercent/100);
        for(uint256 i=0;i<linktoOwner[link].buyers.length;i++){
            payable(linktoOwner[link].buyers[i]).transfer(msg.value*linktoOwner[link].royalty[linktoOwner[link].buyers[i]]/100);
        }
    }

}

